Greetz to all kabayan:) add me on FB TOPSIDER pinoy

Plot

The story is about Tina Benitez (Andi Eigenmann) comes home from abroad to an empty house that she inherited from her parents. Not before long, strange things happen in the house, particularly in the kitchen, where an antique refrigerator is located

Cast

Janice de Belen as Mrs. Benitez/Tina's Mom
Andi Eigenmann as Tina Benitez[6]
JM De Guzman as James/Boyfriend of Tina
Venus Raj as Celine
Baron Geisler as ex-Boyfriend of Tina
Ronnie Lazaro as Detective Albay
Joel Torre as Mr. Benitez/Tina's Father
Bekimon as Maid of Celine

